BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "ClientsData" (
	"CLIENTNAME"	TEXT,
	"Type"	TEXT,
	"St"	TEXT,
	"Activity"	TEXT
);
CREATE TABLE IF NOT EXISTS "ConsultantDeal" (
	"Year"	INTEGER,
	"Month"	INTEGER,
	"ConsultantID"	INTEGER,
	"Consultant"	TEXT,
	"DealDays"	INTEGER,
	"Role"	TEXT DEFAULT 'Consultant'
);
CREATE TABLE IF NOT EXISTS "ConsultantVacation" (
	"Consultant"	TEXT,
	"Days"	INTEGER,
	"Year"	INTEGER,
	"Month"	INTEGER,
	"ConsultantID"	INTEGER
);
CREATE TABLE IF NOT EXISTS "Domains" (
	"DomainID"	INTEGER,
	"DomainName"	TEXT NOT NULL,
	PRIMARY KEY("DomainID")
);
CREATE TABLE IF NOT EXISTS "Feedback" (
	"ID"	INTEGER,
	"Type"	TEXT NOT NULL,
	"Message"	TEXT NOT NULL,
	"User"	TEXT NOT NULL,
	"Timestamp"	DATETIME DEFAULT CURRENT_TIMESTAMP,
	PRIMARY KEY("ID" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "HistData" (
	"RecID"	INTEGER,
	"Source"	TEXT,
	"Year"	INTEGER,
	"MonthNo"	INTEGER,
	"Day"	INTEGER,
	"Month"	TEXT,
	"ConsultantID"	INTEGER,
	"Consultant"	TEXT,
	"Client"	TEXT,
	"ActivityType"	TEXT,
	"WorkingHours"	INTEGER,
	"NOTES"	TEXT,
	"Domain"	TEXT,
	"Subdomain"	TEXT,
	"Scope"	TEXT
);
CREATE TABLE IF NOT EXISTS "HistData0" (
	"Source"	TEXT,
	"Year"	INTEGER,
	"MonthNo"	INTEGER,
	"Day"	INTEGER,
	"Month"	TEXT,
	"ConsultantID"	INTEGER,
	"Consultant"	TEXT,
	"Client"	TEXT,
	"ActivityType"	TEXT,
	"WorkingHours"	INTEGER,
	"NOTES"	TEXT,
	"Domain"	TEXT,
	"Subdomain"	TEXT,
	"Scope"	TEXT
);
CREATE TABLE IF NOT EXISTS "HistData1" (
	"RecID"	INTEGER,
	"Source"	TEXT,
	"Year"	INTEGER,
	"MonthNo"	INTEGER,
	"Day"	INTEGER,
	"Month"	TEXT,
	"ConsultantID"	INTEGER,
	"Consultant"	TEXT,
	"Client"	TEXT,
	"ActivityType"	TEXT,
	"WorkingHours"	INTEGER,
	"NOTES"	TEXT,
	"Domain"	TEXT,
	"Subdomain"	TEXT,
	"Scope"	TEXT,
	PRIMARY KEY("RecID" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "PagePermissions" (
	"User"	TEXT,
	"Page"	TEXT,
	"Access"	TEXT,
	PRIMARY KEY("User","Page")
);
CREATE TABLE IF NOT EXISTS "ScopeTemplates" (
	"TemplateID"	INTEGER,
	"DomainID"	INTEGER NOT NULL,
	"TemplateName"	TEXT NOT NULL,
	"Description"	TEXT,
	PRIMARY KEY("TemplateID" AUTOINCREMENT),
	FOREIGN KEY("DomainID") REFERENCES "Domains"("DomainID")
);
CREATE TABLE IF NOT EXISTS "Scopes" (
	"ScopeID"	INTEGER,
	"SubdomainID"	INTEGER NOT NULL,
	"ScopeName"	TEXT NOT NULL,
	"CreatedBy"	TEXT NOT NULL,
	PRIMARY KEY("ScopeID"),
	FOREIGN KEY("SubdomainID") REFERENCES "Subdomains"("SubdomainID")
);
CREATE TABLE IF NOT EXISTS "Subdomains" (
	"SubdomainID"	INTEGER,
	"DomainID"	INTEGER NOT NULL,
	"SubdomainName"	TEXT NOT NULL,
	"LeadConsultant"	TEXT,
	PRIMARY KEY("SubdomainID" AUTOINCREMENT),
	FOREIGN KEY("DomainID") REFERENCES "Domains"("DomainID")
);
CREATE TABLE IF NOT EXISTS "SuperUsers" (
	"UserID"	TEXT,
	"Username"	TEXT NOT NULL,
	"CreatedDate"	DATETIME DEFAULT CURRENT_TIMESTAMP,
	PRIMARY KEY("UserID")
);
CREATE TABLE IF NOT EXISTS "UserDomains" (
	"UserID"	TEXT NOT NULL,
	"Username"	TEXT NOT NULL,
	"DomainID"	INTEGER NOT NULL,
	PRIMARY KEY("UserID","DomainID"),
	FOREIGN KEY("DomainID") REFERENCES "Domains"("DomainID")
);

